import React from 'react';
import { BrowserRouter, Switch, Route, Link } from 'react-router-dom';

import Home from './screens/Home';
import Detail from './screens/Detail';

const App = () => {
    return (
        <BrowserRouter>
            <Switch>
                <Route path="/detail">
                    <Detail />
                </Route>
                <Route path="/">
                    <Home />
                </Route>
            </Switch>
        </BrowserRouter>
    );
};

export default App;
